    return (
        <Section title="Examples" id="examples">
            <Tabs 
            // ButtonContainer="menu"
            buttons={
                <SizeBar>
                    <TabButton  onClick={() => handleSlect('Home')}>Home</TabButton>
                    <TabButton  onClick={() => handleSlect(' Quản lý Office')}> Quản lý Office </TabButton>
                    <TabButton  onClick={() => handleSlect('Quản lý tuyến xe')}>Quản lý tuyến xe </TabButton>
                    <TabButton  onClick={() => handleSlect('Quản lý đơn hàng')}>Quản lý đơn hàng</TabButton>
                    <TabButton  onClick={() => handleSlect('Quản lý nhân viên')}>Quản lý nhân viên</TabButton>
                    <TabButton  onClick={() => handleSlect('Cài đặt')}>Cài đặt</TabButton>
                </SizeBar>
            }>
                {/* {tabContent} */}
            </Tabs>



        </Section>
    )
}
